    const listItemGUI = createListItemGUI(listItem, e);
    const nextSiblingGUI = e.target.parentNode.parentNode.nextSibling;

    formGUI.remove();
    GlobalNodes.mainContentGUI.insertBefore(listItemGUI, nextSiblingGUI);
    
